/* eslint-disable jsx-a11y/alt-text */
import React from 'react';
import './style.scss';
import Button from '../../../../common/Button/Button';
import * as constant from '../../../../constant';

let items = ['Item 1', 'Item 2', 'Item 3', 'Item 4', 'Item 5'];
let itemList = [];
items.forEach((item, index) => {
	itemList.push(<li key={index}>{item}</li>);
});

function CourseCard(props) {
	const { buttonText, onClick, ...others } = props;
	return (
		<>
			<ul>{itemList}</ul>
			<div className='movie_card' id='bright'>
				<div className='info_section'>
					<div className='movie_header' style={{ float: 'left' }}>
						<h1>Javascript</h1>
						<p className='type'>
							Learn Mobile And Web Development with online Mobile And Web
							Development courses. Take courses from the world's best
							instructors and universities. Courses include recorded auto-graded
							and peer-reviewed assignments, video lectures, and community
							discussion forums. When you complete a course, youâ€™ll be eligible
							to receive a shareable electronic Course Certificate for a small
							fee.
						</p>
					</div>

					<div
						className='course-meta'
						style={{ float: 'left', padding: '25px' }}
					>
						<dl className='row'>
							<dt className='col'>Author</dt>
							<dd className='col'>25</dd>
						</dl>
						<dl className='row'>
							<dt className='col'>Duration</dt>
							<dd className='col'>Bob</dd>
						</dl>
						<dl className='row'>
							<dt className='col'>Created</dt>
							<dd className='col'>Bob</dd>
						</dl>
						<dl className='row'>
							<dt className='col'></dt>
							<dd className='col'>
								<Button buttonText='Show course' />
							</dd>
						</dl>
					</div>
				</div>
			</div>
		</>
	);
}

export default CourseCard;
